import React from "react";

export default function Formatteddate(props) {
  let date = new Date();
  let hours = props.date.getHours();
  if (hours < 10) {
    hours = `0${hours}`;
  }
  let minutes = date.getMinutes();
  if (minutes < 10) {
    minutes = `0${minutes}`;
  }

  return <div className="time-stamp">

`${hours}:${minutes}`;
